Content:
@dokrates also it may help to just think of those bullruns as a warmup... some pairs getting twitchy when they see what's coming for the whole space... also pump and dump groups/whales (and just experienced traders) will want to cycle and take profits from one and put into another, so consider the possibility those pumps just serving that purpose ;)

you'll see similar behaviour in USD forex pairs. USD index may be ready for a sell off, but some pairs will move ahead, some will lag, but eventually they all correlate on some level during major USD moves. 

as hyperdex says there seems to have been some news to use, but often news just serves as a means to an end that would exist with or without news IMO
